import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import React, { useContext, useEffect, useState, ChangeEventHandler, MouseEventHandler } from "react";
import { useHistory, useParams } from "react-router-dom";
import { ICompanyData } from "../../types";
import CompanyCard from "../../components/CompanyCard/CompanyCard";
import CompareForm from '../../components/Compare/CompareForm';


interface HomeScreenProps {
  companyVAT: string[],
  companyInfo: ICompanyData[],
  setCompanyInfo: React.Dispatch<React.SetStateAction<ICompanyData[]>>,
  submit: React.MouseEventHandler<HTMLButtonElement>,
  handleVat: React.ChangeEventHandler<HTMLInputElement>,


}

const HomeScreen = ({companyInfo, companyVAT, submit, handleVat, setCompanyInfo }: HomeScreenProps) => {

  return (
    <main>
      <CompareForm companyVAT={companyVAT} submit={submit} handleVat={handleVat} companyInfo={companyInfo}  setCompanyInfo = {setCompanyInfo}/>
    </main>
  );
}
export default HomeScreen;
